from pwn import xor

#encryption generates from the bean counter interaction page
ct = ""
ct = bytes.fromhex(ct)

#we know png file is encrypted via source code and png files have a specific header
#ie the one used below. we can find the iv by reverse engineering ie xor first 16 bytes
#of (first 32 hex characters) the ciphertext with the know png header. This was found
#using the interaction page for the challenge as you can see in the provided img.
#Lastly iv xored with ct to get the final image.
iv = "18e7f53ae8c09e059b4bf90d023d2280"
iv = bytes.fromhex(iv)

#now we use the key to xor with the whole png header data
val=xor(iv, ct)
with open('bean.png','wb') as f:
    f.write(bytes(val))